import gafasImage from '../img/gafas.png';
import guantesImage from '../img/guantes.jpg';
import mascaraImage from '../img/mascara.png';

const Home = () => {
  return (
    <header className="header-container">
      <h1>Tu seguridad es nuestra prioridad</h1>
    </header>
